import React, { Component } from "react";
import { Container, Row, Col } from 'react-bootstrap';
import "./headerCard.css";


class HeaderCard extends Component {
    render() {
        return (
            <Container>
                <Row className="my-3">
                    <img id="logoEsogu" class="col-md-auto" src="esogu-logo.png" />
                    <div class="col my-4">
                        <span class="bold header">Eskişehir Osmangazi Üniversitesi</span>
                        <br />
                        Öğrenci Yönetim Sistemi
                    </div>

                </Row>
            </Container>
        )
    }
}

export default HeaderCard;
